import { DonutLarge } from '@material-ui/icons';
import React, { Component } from 'react';


import {useSpring, animated} from "react-spring";



const TestSpring = ()=>{

   


        const styleProp = useSpring({
            opacity: 1, from:{opacity:0.0}
        })
        const AnimateDonut = animated(DonutLarge)
;
        return (

           

            <div> 
           <AnimateDonut style={styleProp}> Test Donut</AnimateDonut>
            
</div>

        )
            
        
    }


    

export default TestSpring;
